import React, { Component } from 'react';
import Column_content from './component/column_content';
import './column_text.css';
import {NavBar_in} from '../../component/AppBar_in';

class Column_2001 extends Component{
    render(){
        return (
			<div id = "column_container">
				<div id = "column_titlepage" style={{marginTop:"8%"}} >
					Constructing
				</div>
				<div id = "column_text_background" >
					<div id = "column_textpage">
						Constructing
					</div>
				</div>
			</div>
        )
		
        
    }
}

export default Column_2001
